    "ep_dsc_0113"              : "\u30EC\u30C7\u30A3\u30FBM\u306E\u63A8\u85A6\u3067\u52A0\u5165\u3057\u305F\u7F8E\u96F2\u3002\n\u305D\u306E\u6B4C\u58F0\u3092\u8074\u3044\u305F\u30E1\u30F3\u30D0\u30FC\u306F\u5FC3\u6A5F\u4E00\u8EE2\u3001\n\u6700\u9AD8\u306E\u30E6\u30CB\u30C3\u30C8\u3092\u76EE\u6307\u3057\u3066\u6B69\u307F\u59CB\u3081\u305F\u3002",
    "ep_dsc_0114"              : "\u304B\u3064\u3066\u306F\u8131\u9000\u307E\u3067\u8003\u3048\u305F\u30DE\u30AD\u30CA\u3002\n\u5F7C\u5973\u304C\u5E0C\u671B\u3092\u6368\u3066\u305A\u9811\u5F35\u3063\u305F\u304B\u3089\u3053\u305D\u3001\n\u4ECA\u306E\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u306E\u59FF\u304C\u3042\u308B\u3068\u3044\u3048\u308B\u3002",
    "ep_dsc_0115"              : "\u30D5\u30EC\u30A4\u30A2\u306E\u6B4C\u58F0\u3092\u611F\u3058\u53D6\u3063\u305F\u30CF\u30E4\u30C6\u306F\u3001\n\u521D\u3081\u3066\u7A7A\u3092\u98DB\u3093\u3060\u65E5\u306E\u611F\u899A\u3092\u53D6\u308A\u623B\u3059\u3002\n\u6B8B\u308A\u6642\u9593\u306F\u3042\u3068\u50C5\u304B\u3002\u8A66\u9A13\u306E\u7D50\u679C\u306F\u2026\uFF1F",
    "ep_dsc_0116"              : "\u4EF2\u9593\u305F\u3061\u3068\u4EA4\u6D41\u3057\u30E9\u30A4\u30D6\u3092\u91CD\u306D\u308B\u3053\u3068\u3067\n\u6210\u9577\u3057\u3066\u304D\u305F\u30DF\u30EC\u30FC\u30CC\u3060\u304C\u3001\u53CB\u60C5\u3068\u604B\u306E\n\u5224\u65AD\u306F\u307E\u3060\u66D6\u6627\u306A\u3068\u3053\u308D\u304C\u3042\u308B\u3088\u3046\u3060\u3002",
    "ep_dsc_0117"              : "\u3069\u3053\u304B\u3089\u304B\u30AD\u30E3\u30ED\u30EB\u304C\u805E\u3053\u3048\u3066\u304D\u305D\u3046\u306A\n\u7C89\u96EA\u306E\u821E\u3046\u591C\u3002\u4EBA\u3005\u306F\u4E92\u3044\u306B\u5BC4\u308A\u6DFB\u3044\u3001\n\u8D08\u308A\u7269\u3092\u4EA4\u308F\u3057\u60F3\u3044\u3092\u78BA\u304B\u3081\u3042\u3046\u306E\u3060\u3002",
    "ep_dsc_0118"              : "\u5FC3\u3082\u8857\u3082\u3001\u307F\u3093\u306A\u304C\u714C\u3081\u304F\u30AF\u30EA\u30B9\u30DE\u30B9\u3002\n\u5922\u3068\u5E0C\u671B\u306B\u5F69\u3089\u308C\u305F\u8056\u591C\u306B\u3001\u6B4C\u59EB\u305F\u3061\u306F\n\u4E00\u4F53\u3069\u3093\u306A\u8D08\u308A\u7269\u3092\u9858\u3046\u306E\u3060\u308D\u3046\uFF1F",
    "ep_dsc_0119"              : "\u521D\u65E5\u306E\u51FA\u3068\u3068\u3082\u306B\u65B0\u3057\u30441\u5E74\u304C\u59CB\u307E\u308B\u3002\n\u304A\u6B63\u6708\u3092\u5B58\u5206\u306B\u6E80\u55AB\u3059\u308B\u4EBA\u3005\u306E\u5FC3\u3082\u3001\n\u65B0\u5E74\u3092\u795D\u3046\u6C17\u6301\u3061\u3068\u671F\u5F85\u3067\u8F1D\u3044\u3066\u3044\u308B\u3002",
    "ep_dsc_0120"              : "\u521D\u8A63\u306E\u304F\u3058\u5F15\u304D\u306F\u7279\u5225\u306A\u3082\u306E\u3002\n\u521D\u6625\u306E\u967D\u6C17\u306B\u3042\u3066\u3089\u308C\u3066\u3001\u3044\u3044\u7D50\u679C\u304C\n\u51FA\u308B\u307E\u3067\u3064\u3044\u4F55\u5EA6\u3082\u5F15\u3044\u3066\u3057\u307E\u3046\u304B\u3082\uFF1F",
    "ep_dsc_0121"              : "\u7F8E\u96F2\u3092\u6551\u3044\u51FA\u3059\u305F\u3081\u3001\u547D\u3092\u61F8\u3051\u3066\u6B4C\u3046\n\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u3068\u305D\u308C\u3092\u5B88\u308B\u30C7\u30EB\u30BF\u5C0F\u968A\u3002\n\u81EA\u7531\u306A\u7A7A\u3068\u98A8\u3092\u61F8\u3051\u305F\u6C7A\u6226\u306E\u884C\u65B9\u306F\u2026",
    "ep_dsc_0122"              : "\u6587\u5316\u3068\u4EBA\u985E\u5B58\u7D9A\u306E\u305F\u3081\u3001\u5B87\u5B99\u3078\u65C5\u7ACB\u3061\n\u5E7E\u5149\u5E74\u3002\u9280\u6CB3\u3068\u4E16\u4EE3\u3092\u8D85\u3048\u308B\u679C\u3066\u306A\u304D\n\u65C5\u8DEF\u3088\u3002\u3042\u309D\u3001\u4EBA\u751F\u306F\u30C7\u30AB\u30EB\u30C1\u30E3\u30FC\u3002",
    "ep_dsc_0123"              : "\u30EA\u30F3\u30FB\u30DF\u30F3\u30E1\u30A4\u306E\u529F\u7E3E\u3092\u8B83\u3048\u305F\u30C9\u30E9\u30DE\u306E\n\u51FA\u6F14\u306B\u3001\u4F55\u3084\u3089\u5F15\u3063\u304B\u304B\u308B\u3082\u306E\u3092\u611F\u3058\u305F\n\u30D0\u30B5\u30E9\u3002\u6C17\u306B\u306A\u308B\u30C9\u30E9\u30DE\u306E\u5185\u5BB9\u3068\u306F\u2026\uFF1F",
    "ep_dsc_0124"              : "\u30EA\u30F3\u30FB\u30DF\u30F3\u30E1\u30A4\u3092\u6F14\u3058\u306A\u304C\u3089\u6226\u5834\u306B\u6B4C\u3092\n\u97FF\u304B\u305B\u308B\u30DF\u30EC\u30FC\u30CC\u3002\u904E\u53BB\u3068\u73FE\u5728\u304C\u91CD\u306A\u308A\n\u3042\u3046\u6642\u3001\u5F7C\u5973\u306E\u5FC3\u306B\u53BB\u6765\u3059\u308B\u60F3\u3044\u3068\u306F\u2026",
    "ep_dsc_0125"              : "\u300C\u30B9\u30FC\u30D1\u30FC\u30FB\u30CE\u30F4\u30A1\u8A08\u753B\u300D\u306E\u5185\u306E1\u6A5F\u3001\nYF-19\u3002\u30D4\u30FC\u30AD\u30FC\u306A\u64CD\u7E26\u6027\u3067\u4E8B\u6545\u304C\u591A\u767A\u3001\n\u672C\u6765\u306E\u9AD8\u3044\u6027\u80FD\u3092\u767A\u63EE\u3067\u304D\u305A\u306B\u3044\u305F\u304C\u2026",
    "ep_dsc_0126"              : "\u300C\u30B9\u30FC\u30D1\u30FC\u30FB\u30CE\u30F4\u30A1\u8A08\u753B\u300D\u306E\u5185\u306E1\u6A5F\u3001\nYF-21\u3002\u9769\u65B0\u7684\u6280\u8853\u3092\u642D\u8F09\u3057\u3001\u8A66\u9A13\u3082\n\u512A\u4F4D\u306B\u9032\u3081\u3089\u308C\u3066\u3044\u308B\u304B\u306B\u898B\u3048\u305F\u304C\u2026",
