    "ep_dsc_0389"              : "\u8D64\u3092\u5DEE\u3057\u8272\u306B\u3057\u305F\u9ED2\u306E\u304A\u3057\u3083\u308C\u306A\u6D0B\u670D\n\u3067\u7740\u98FE\u3063\u305F\u30D5\u30EC\u30A4\u30A2\u3002\u3069\u3053\u306B\u51FA\u3057\u3066\u3082\n\u6065\u305A\u304B\u3057\u304F\u306A\u3044\u7ACB\u6D3E\u306A\u304A\u5B22\u3055\u3093\u306E\u59FF\u3060\u3002",
    "ep_dsc_0390"              : "\u7D1B\u308C\u3082\u306A\u3044\u611B\u304C\u8FBC\u3081\u3089\u308C\u305F\u30B7\u30A7\u30EA\u30EB\u306E\n\u6B4C\u58F0\u3002\u7518\u304F\u5207\u306A\u304F\u5BC4\u308A\u6DFB\u3046\u3088\u3046\u306A\u6B4C\u306F\u3001\n\u5C11\u3057\u82E6\u307F\u3068\u5171\u306B\u4EBA\u3005\u306E\u5FC3\u3092\u9707\u308F\u305B\u308B\u3002",
